parameters.raw_body:
{
  "orderDate": "{{Data.CSVTranslator.StartDate}}",
  "newAccount": {
        "autoPay": true,
        "billCycleDay": {{Data.CSVTranslator.BCD}},
        "billToContact": {
            "address1": "{{Data.CSVTranslator.Address}}",
            "city": "{{Data.CSVTranslator.City}}",
            "country": "{{Data.CSVTranslator.Country}}",
            "firstName": "{{Data.CSVTranslator.AccountName}}",
            "lastName": ".",
            "postalCode": "{{Data.CSVTranslator.PostalCode}}",
            "state": "{{Data.CSVTranslator.State}}",
            "workEmail": "{{Data.CSVTranslator.Email}}"
        },
        "creditCard": {
            "cardHolderInfo": {
                "addressLine1": "{{Data.CSVTranslator.Address}}",
                "cardHolderName": "{{Data.CSVTranslator.CardHolderName}}",
                "city": "{{Data.CSVTranslator.City}}",
                "country": "{{Data.CSVTranslator.Country}}",
                "email": "{{Data.CSVTranslator.Email}}",
                "state": "{{Data.CSVTranslator.State}}",
                "zipCode": "{{Data.CSVTranslator.PostalCode}}"
            },
            "cardNumber": "4111111111111111",
            "cardType": "Visa",
            "expirationMonth": 12,
            "expirationYear": {{ "now" | date_manip: '+', 2, 'year' | date: "%Y" }},
            "securityCode": "111"
        },
        "currency": "{{Data.CSVTranslator.Currency}}",
        "name": "{{Data.CSVTranslator.AccountName}}",
        "paymentTerm": "Due Upon Receipt",
        "soldToContact": {
            "address1": "{{Data.CSVTranslator.Address}}",
            "city": "{{Data.CSVTranslator.City}}",
            "country": "{{Data.CSVTranslator.Country}}",
            "firstName": "{{Data.CSVTranslator.AccountName}}",
            "lastName": ".",
            "postalCode": "{{Data.CSVTranslator.PostalCode}}",
            "state": "{{Data.CSVTranslator.State}}",
            "workEmail": "{{Data.CSVTranslator.Email}}"
        }
    },
  "subscriptions": [
    {
      "orderActions": [
                {
                    "createSubscription": { 
                        "subscriptionNumber": "{{Data.CSVTranslator.SubscriptionName}}",
                      	"invoiceSeparately": true,
                        "subscribeToRatePlans": [
                            {
                                "productRatePlanId": "{{Data.CSVTranslator.PRPID}}"{% if Data.CSVTranslator.Overwrite_PRPCIDTIERED != blank %},

                                "chargeOverrides": [
                                    {
                                        "productRatePlanChargeId": "{{Data.CSVTranslator.Overwrite_PRPCIDTIERED}}",
                                        "pricing": {
                                            "recurringTiered": {
                                                "quantity": {{Data.CSVTranslator.Overwrite_PRPCQTY}}
                                            }
                                        }
                                    }
                                ]{% endif %} 
                            }{% if Data.CSVTranslator.PRPID2 != blank %},
                            {
                                "productRatePlanId": "{{Data.CSVTranslator.PRPID2}}"
                            }
													{% endif %}  
                        ],
                        "terms": {
                            "autoRenew": true,
                            "initialTerm": {
                                "period": {{Data.CSVTranslator.TermInMonths}},
                                "periodType": "Month",
                                "startDate": "{{Data.CSVTranslator.StartDate}}",
                                "termType": "TERMED"
                            },
                            "renewalSetting": "RENEW_WITH_SPECIFIC_TERM",
                            "renewalTerms": [
                                {
                                    "period": {{Data.CSVTranslator.TermInMonths}},
                                    "periodType": "Month"
                                }
                            ]
                        }
                    },
                    "triggerDates": [
                        {
                            "name": "ContractEffective",
                            "triggerDate": "{{Data.CSVTranslator.StartDate}}"
                        },
                        {
                            "name": "ServiceActivation",
                            "triggerDate": "{{Data.CSVTranslator.StartDate}}"
                        },
                        {
                            "name": "CustomerAcceptance",
                            "triggerDate": "{{Data.CSVTranslator.StartDate}}"
                        }
                    ],
                    "type": "CreateSubscription"
                }
      ]
    }
  ],
  "processingOptions": {
     "billingOptions": {
         "documentDate": "{{Data.CSVTranslator.StartDate}}",
         "targetDate": "{{Data.CSVTranslator.StartDate}}"
     },
    "runBilling": true,
    "collectPayment": false
  }
}

